function Login(){
  return (
    <div className='login'>
        <h1 className='menu'>Login</h1>
            <input className='menu' type="text" name="" id="" placeholder='Enter your Email'/>
            <input className='menu' type="text" name="" id="" placeholder='Enter your password'/>
            <button className='menu'>Login</button>
    </div>
  );
}

export default Login;
